import { Link } from "react-router-dom";

export default function Tips() {
  const tips = [
    "Tip 1",
    "Tip 2",
    "Tip 3",
    "Tip 4",
    "Tip 5",
    "Tip 6",
    "Tip 7",
  ];

  return (
    <div className="min-h-screen px-6 flex flex-col items-center justify-center">
      <h1 className="text-lg font-semibold mb-4 text-center">
        TIPS ON TRACKING WASTE AND RECYCLING
      </h1>

      {tips.map((tip, i) => (
        <Link
          to={`/tip/${i + 1}`}
          key={i}
          className="border w-full p-3 mb-2 rounded text-center bg-gray-100"
        >
          {tip}
        </Link>
      ))}
    </div>
  );
}
